import React from "react"

class Services extends React.Component { 
  render() {
    return (
      <header>
        <div>
            <ul className = "header">
                <li>Про нас</li>
                <li>Услуги</li>
                <li>Почему мы?</li>
                <li>Специалисты клиники</li>
                <li>Отзывы</li>
                <li>Контакты</li>
            </ul>
        </div>
      </header>
    )
  }
}

export default Services
